import {Formik} from "formik";

const Login = () => {
    return <div>
        login
        <Formik
            initialValues={{
                name: '',
            }}>
            {
                ({values,}) => (
                    <input
                        name={'name'}
                    />
                )
            }
        </Formik>
    </div>
}

export default Login;
